import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { Button, Stack, IconButton, Divider, Card } from "@mui/material";
import {
  DirectionsCar,
  BarChart,
  AttachMoney,
  Email,
  Apartment,
  DateRange,
} from "@mui/icons-material";

export default function Main({ name }) {
  let navigate = useNavigate();
  useEffect(() => {
    if (localStorage.getItem("Chainrents_id")) {
      navigate({
        pathname: "/dashboard",
        search: `?id=${localStorage.getItem("Chainrents_id")}`,
      });
      return;
    }
  }, []);
  return (
    <>
      <Stack
        direction="row-reverse"
        spacing={2}
        padding={1}
        className="stack-container"
      >
        <text
          className="delispeed"
          style={{ fontSize: window.innerWidth < 400 ? "1.6rem" : `1.8rem` }}
        >
          <b>{name}</b>
        </text>
        <Button variant="outlined" onClick={() => navigate("/login")}>
          login
        </Button>
        <Button variant="outlined" onClick={() => navigate("/signup")}>
          Sign up
        </Button>
      </Stack>
      <div className="description">
        <h1 style={{ marginLeft: "2%" }}>Track rental assets</h1>
        {/* <h2 style={{ marginLeft: "2%" }}>
            Earn money every month on vehicle fleet rental
          </h2> */}
      </div>

      <div className="icon-buttons">
        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <IconButton
            style={{ display: "flex", flexDirection: "column", color: "black" }}
          >
            <DirectionsCar sx={{ fontSize: 100, color: "black" }} />
          </IconButton>
          <text>
            <b>Rental cars</b>
          </text>
        </div>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <IconButton
            style={{ display: "flex", flexDirection: "column", color: "black" }}
          >
            <Apartment sx={{ fontSize: 100, color: "black" }} />
          </IconButton>
          <text>
            <b>Apartments</b>
          </text>
        </div>
      </div>
      <div className="working">
        <Card
          sx={{
            backgroundColor: "azure",
            padding: "3%",
            margin: "2%",
          }}
        >
          <h1>
            <Divider>How it works</Divider>
          </h1>
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <h2>Each rental is recorded</h2>
            <DateRange sx={{ fontSize: 100, color: "black" }} />
            <h2>RentlinksGraph shows rental days</h2>
            <BarChart sx={{ fontSize: 100, color: "black" }} />
          </div>
        </Card>
      </div>
    </>
  );
}
